const Start = props =>{

    const history = useHistory();

    function HandleSubmit(){
        history.push("https://cloudcomputingmusicapp.auth.us-east-1.amazoncognito.com/login?client_id=5mlcifkn3e78vco1olg3ael3v9&response_type=token&scope=phone+email+openid+aws.cognito.signin.user.admin+profile&redirect_uri=http://localhost:3000/smart-tunes");
    }

    const location = useLocation();
    const params = new URLSearchParams(window.location.search);
    const token = params.get('id_token');
    if(token != null){
        props.isLogin = true;
    }

    return(
        <div className='center'>
            <div className='div-login-logo'>
                <h1>Smart Tunes</h1>
            </div>
            <div>
                <form onSubmit = {HandleSubmit}>
                    <button onSubmit={HandleSubmit}>Log In</button>
                </form>
            </div>
        </div>
    )

}

